import React from "react";

const Benefits = () => {
  return (
    <>
      <div className="bg-secondary flex justify-between p-8  flex-col md:flex-row ">
        <div className="w-80 bg-white flex flex-col items-center">
          <div className="self-center">
            {" "}
            <img src="/images/mask.png " className="w-20 mb-4 "></img>{" "}
          </div>
          <div>
            <p className="text-xl font-bold">10K+ Happy customers</p>
            <p className="text-sm font-medium">
              HOMEOZ operates across the globe.
            </p>
          </div>
        </div>
      </div>
    </>
  );
};

export default Benefits;
